Wanneer een experimentele ruimtevlucht verkeerd afloopt veranderen Reed Richards, Sue Storms, haar broer Johnny Storms en piloot Ben Grimm van lichaamsstructuur, waardoor zij superkrachten krijgen. Al snel wordt dit bekend aan de buitenwereld, die ze een superhelden status geeft. De elastische Mr. Fantastic, de onzichtbare Invisible Woman, de ontvlambare Human Torch en the Thing, een man van steen met enorme krachten, bundelen als 'the Fantastic Four' hun nieuw verworven kunsten samen om Victor von Doom tegen te houden, die snode plannen heeft met de wereld!:
